import personService from '../services/persons'

const Person = (props) => {
  const {personObject, deletePerson} = props
  return (
    <div>
      <div>{personObject.name} {personObject.number}</div>
      <Button handleClick={deletePerson(person.id)} label='delete'/>
    </div>
  )
}

const Button = (props) => {
  <button onClick={props.handleClick}>{props.label}</button>
}

const FilteredList = (props) => {
  const {filteredPeople, deletePerson} = props

  return (
    <div>
      {filteredPeople.map(person =>
        <Person key={person.id} personObject={person} deletePerson={deletePerson}/>
      )}
    </div>
  )
}

export default FilteredList
